export default function Podcast(props) 
{

  let season = props.season;
  let episode = props.episode;
  let episodeTitle = props.episodeTitle;

  if (season>="1") {
    return(
      <div>
      <h1 id="title">{episodeTitle}</h1>
      <h1 id="subtitle">Season:{season} Episode: {episode}</h1>
      </div>


    )  

  }
  return (
    <div>
    <h1 id="title">{episodeTitle}</h1>
    <h1 id="subtitle">Episode: {episode}</h1>
    </div>



  );
}
